import "./App.css";
import denverpic from "./assets/img/Denver.jpeg";

function App() {
  return (
    <div className="App">
      <header className="headercontainer">Denver Open Jam</header>
      <img className="mainpic" src={denverpic}></img>
    </div>
  );
}

export default App;
